How to perform $match after $lookup in mongoDB<p>Here I have two collections</p>
<p><strong>Category</strong></p>
<pre><code>[
    {
      id: 1,
      name: &quot;MEN&quot;,
      status: true
    },
    {
      id: 2,
      name: &quot;WOMEN&quot;,
      staus: true
    }
  ]
</code></pre>
<p><strong>Service</strong></p>
<pre><code>[
    {
      name: &quot;service a&quot;,
      category_id: 1,
      status: true
    },
    {
      name: &quot;service b&quot;,
      category_id: 1,
      status: true
    },
    {
      name: &quot;service c&quot;,
      category_id: 1,
      status: true
    },
    {
      name: &quot;service d&quot;,
      category_id: 1,
      status: false
    }
  ]
</code></pre>
<p>I want all services in the category wise. for that, I have used <code>lookup</code> aggression. I have added one more stage in aggression to filter the service with status true.</p>
<p>I have tried with the following.</p>
<pre><code>db.category.aggregate([
  {
    &quot;$lookup&quot;: {
      &quot;from&quot;: &quot;services&quot;,
      &quot;localField&quot;: &quot;id&quot;,
      &quot;foreignField&quot;: &quot;category_id&quot;,
      &quot;as&quot;: &quot;services&quot;
    }
  },
  {
    &quot;$match&quot;: {
      &quot;services.status&quot;: true
    }
  }
])
</code></pre>
<p><strong>Expected Output</strong></p>
<pre><code>[
  {
    &quot;_id&quot;: ObjectId(&quot;5a934e000102030405000000&quot;),
    &quot;id&quot;: 1,
    &quot;name&quot;: &quot;MEN&quot;,
    &quot;services&quot;: [
      {
        &quot;_id&quot;: ObjectId(&quot;5a934e000102030405000002&quot;),
        &quot;category_id&quot;: 1,
        &quot;name&quot;: &quot;service a&quot;,
        &quot;status&quot;: true
      },
      {
        &quot;_id&quot;: ObjectId(&quot;5a934e000102030405000003&quot;),
        &quot;category_id&quot;: 1,
        &quot;name&quot;: &quot;service b&quot;,
        &quot;status&quot;: true
      },
      {
        &quot;_id&quot;: ObjectId(&quot;5a934e000102030405000004&quot;),
        &quot;category_id&quot;: 1,
        &quot;name&quot;: &quot;service c&quot;,
        &quot;status&quot;: true
      },
    ],
    &quot;status&quot;: true
  }
]
</code></pre>
<p>Have a look at <a href="https://mongoplayground.net/p/FXNakB7cLse" rel="nofollow noreferrer">https://mongoplayground.net/p/FXNakB7cLse</a>.</p>

