How to return multiple documents using find() with list of matching values<p>I am testing find() and $in where I provide an array with a list of matched names as the query input to find corresponding _id. However, I can only get one matched (the 1st one) even I have multiple matched user names in the array.</p>
<p>How can I return multiple matches using a list of user names as the query input? Is &quot;$in&quot; the right approach?</p>
<p>ps: I am relative new to web programming; id below are masked;</p>
<pre><code> exports.getUserID = (req, res, next) =&gt; {
  const namearray = req.body.name.split(',');
  console.log('name array:', namearray);
  const myCursor = User.find({ name: { $in: namearray } }).then(users =&gt; {
    users.forEach(user =&gt; {
      console.log('found user id:', user._id);
    });
    res.status(200).send(users);
  });
};
</code></pre>
<p>It returns only one document as below even the namearray has 3 matched names.</p>
<pre><code>[
{
&quot;works&quot;: [],
&quot;_id&quot;: &quot;6xxxxxxxxxxxxx&quot;,
&quot;name&quot;: &quot;user1&quot;,
&quot;email&quot;: &quot;user1@test.com&quot;,
&quot;__v&quot;: 0
}
]
</code></pre>
<p>the console outputs:</p>
<pre><code>name array: [ 'user1', ' user2', ' user3' ]
found user id: 6xxxxxxxxxxxxx
</code></pre>
<p>if I hardcode a list of name using an array (userName) as the following, it works fine.</p>
<pre><code>exports.getUserID = (req, res, next) =&gt; {
  const userNAME = ['user1', 'user2', 'user3'];
  // const namearray = req.body.name.split(',');
  const myCursor = User.find({ name: { $in: userNAME } }).then(users =&gt; {
    users.forEach(user =&gt; {
      console.log('found user id:', user._id);
    });
    res.status(200).send(users);
  });
};
</code></pre>
<p>It returns 3 matched documents when hardcoding name array.</p>
<pre><code>[
{
&quot;works&quot;: [],
&quot;_id&quot;: &quot;6xxxxxxxxxxxxx&quot;,
&quot;name&quot;: &quot;user1&quot;,
&quot;email&quot;: &quot;user1@test.com&quot;,
&quot;__v&quot;: 0
},
{
&quot;works&quot;: [],
&quot;_id&quot;: &quot;6xxxxxxxxxxxxx&quot;,
&quot;name&quot;: &quot;user2&quot;,
&quot;email&quot;: &quot;user2@test.com&quot;,
&quot;__v&quot;: 0
},
{
&quot;works&quot;: [],
&quot;_id&quot;: &quot;6xxxxxxxxxxxxx&quot;,
&quot;name&quot;: &quot;user3&quot;,
&quot;email&quot;: &quot;user3@test.com&quot;,
&quot;passwordChangedAt&quot;: &quot;2019-07-01T00:00:00.000Z&quot;,
&quot;__v&quot;: 0
}
]
</code></pre>
<p>the console outputs:</p>
<pre><code>found user id: 6xxxxxxxxxxxx1
found user id: 6xxxxxxxxxxxx2
found user id: 6xxxxxxxxxxxx3
</code></pre>
<p>here is my html code:</p>
<pre><code>&lt;!DOCTYPE html&gt;
&lt;html&gt; 
    &lt;form action=&quot;/users/getUserID&quot; method=&quot;POST&quot; id=&quot;getuserid&quot; enctype=&quot;application/x-www-form-urlencoded&quot;&gt; 
        &lt;div&gt;
            &lt;label for=&quot;name&quot;&gt; Enter User Name(s) (separate users by comma): &lt;/label&gt; 
            &lt;input type=&quot;text&quot; id=&quot;name&quot; name=&quot;name&quot;&gt;
        &lt;button id=&quot;getuserid&quot; type=&quot;submit&quot;&gt; Get ID &lt;/button&gt; 
        &lt;/div&gt;
    &lt;/form&gt;
&lt;/html&gt;
</code></pre>
<p>ps: later I would then save the found user ids as an object ID array to write into another collection with a field with objectID array as its schema</p>

