<p>PersonEntity</p>
<pre><code>@Data
@Document(collection = &quot;products&quot;)
public class ProductEntity implements Serializable {

    private static final long serialVersionUID = -8118791879505582652L;

    @MongoId(FieldType.STRING)
    private String id;

    @Indexed
    @Field(&quot;name&quot;)
    private String name;

    @Field(&quot;category&quot;)
    @DBRef(lazy = true)
    private CategoryEntity category;

    // getters and setters
}
</code></pre>
<p>CategoryEntity</p>
