Getter/Setter Mongoose FeathersJS on get or find<p>When using getter or setter in a mongoose schema, it is only call on create.
It's the same for a transform function in toJSON or toObject in schema options.
On a get or find there is no console.log()</p>
<pre class="lang-js prettyprint-override"><code>const schema = new Schema({
    imageId: {
      type: String,
      get: (v) =&gt; {
        console.log('Here');
        return v;
      }
    },
  }, {
    timestamps: true
    toJSON: {
      transform: (doc, ret, options) =&gt; {
        console.log('Here too');
      }
    }
    }
  });
</code></pre>
<p>Do you know how make them work on get and find ?</p>
<p>Thanks</p>

