How to mapping an entity to multiple mongodb collection in Spring Data MongoDB with JPA without use MongoTempalte directly?<p>I'm using <code>org.mongodb:bson:4.1.2</code> with <code>org.springframework.boot:spring-boot-starter-data-mongodb:2.4.7</code>.</p>
<p>My entity looks like:</p>
<pre><code>@Entity
@Table(name = &quot;fire_alert&quot;)
@Cache(usage = CacheConcurrencyStrategy.READ_WRITE)
@Document(collection = &quot;alert_&lt;dynamic&gt;&quot;)
@Data
public class AlertPO implements Serializable {

    private static final long serialVersionUID = 1L;

    @Id
    @GeneratedValue(strategy = GenerationType.IDENTITY)
    private Long id;

    @Column(name = &quot;owner_id&quot;)
    private Long ownerId;

    @Column(name = &quot;alert_type&quot;)
    private Long alertType;
}
</code></pre>
<p>Cause there will be millions of alerts, so I need to save records into different mongodb collections based on <code>AlertPO.alertType</code>.</p>
<p>After digging into <code>org.springframework.data.mongodb.core.mapping.BasicMongoPersistentEntity</code>, I found the field <code>collection</code> of annotation <code>@Document</code> support <code>SpEL</code> expression. This kind of expressions will be evaluated in <code>org.springframework.data.mongodb.core.mapping.BasicMongoPersistentEntity#getCollection</code> and  it is obviously that current entity won't be added into the <code>EvaluationContext</code>.</p>
<p>According to this question:</p>
<p><a href="https://stackoverflow.com/questions/52282952/how-to-map-a-java-entity-to-multiple-mongodb-collections-in-spring-data">How to Map a Java Entity to Multiple MongoDB Collections in Spring Data?</a></p>
<p>We can overwrite repositories to use <code>MongoTemplate</code> to persistent data into proper collection programmatically. But we're going to using JPA and we do not want to using <code>MongoTemplate</code> directly. How to do this?</p>

