Create Key list from a MongoDB collection - Mongoosh / MongoDB scripting<p>I am currently trying to tackle a problem using MongoDB scripting. Let me try to explain what i want to achieve:
Given a MongoDB Document(s), i should be able to generate an array of keys in the document, even if the document has nested documents that too should be shown in the array using dot operator. I was successful doing this using JS. Below is the piece of code that i used in JS:</p>
<pre><code>function getDeepKeys(obj) {
  var keys = [];
  const idRegex = new RegExp('_id.*');
  for (var key in obj) {
    if (!(idRegex.test(key))) { //exclude the id fields from the final keys array
      keys.push(key);
      if (typeof obj[key] === &quot;object&quot;) {
        var subkeys = getDeepKeys(obj[key]);
        keys = keys.concat(subkeys.map(function (subkey) {
          return key + &quot;.&quot; + subkey;
        }));
      }
    }
  }
  return keys;
}
</code></pre>
<p>if i give the below sample input:</p>
<pre><code>{
  &quot;_id&quot;: {
    &quot;$oid&quot;: &quot;613714789a01802b620c2379&quot;
  },
  &quot;name&quot;: &quot;Example 2&quot;,
  &quot;address&quot;: &quot;Highway 2&quot;,
  &quot;documentType&quot;: &quot;details&quot;,
  &quot;personalDetails&quot;: {
    &quot;gender&quot;: &quot;male&quot;,
    &quot;age&quot;: 23,
    &quot;position&quot;: null
  }
}
</code></pre>
<p>I get the below output:</p>
<pre><code>[
  'name',
  'address',
  'documentType',
  'personalDetails',       
  'personalDetails.gender',
  'personalDetails.age',
  'personalDetails.position'
]
</code></pre>
<p>Can i achieve the same in MongoDB scripting. So far i have found an aggregate function that returns only the top level keys and fails to return the inner document keys:</p>
<pre><code>db.customers.aggregate([
    { &quot;$project&quot;: {
       &quot;hashmaps&quot;: { &quot;$objectToArray&quot;: &quot;$$ROOT&quot; } 
    } }, 
    { &quot;$project&quot;: {
       &quot;fields&quot;: &quot;$hashmaps.k&quot;
    } },
    { &quot;$group&quot;: {
        &quot;_id&quot;: null,
        &quot;fields&quot;: { &quot;$addToSet&quot;: &quot;$fields&quot; }
