    { &quot;$project&quot;: {
            &quot;keys&quot;: {
                &quot;$setDifference&quot;: [
                    {
                        &quot;$reduce&quot;: {
                            &quot;input&quot;: &quot;$fields&quot;,
                            &quot;initialValue&quot;: [],
                            &quot;in&quot;: { &quot;$setUnion&quot; : [&quot;$$value&quot;, &quot;$$this&quot;] }
                        }
                    },
                    [&quot;_id&quot;]
                ]
            }
        }
    }
]).toArray()[0][&quot;keys&quot;];
</code></pre>
<p>which returns this:</p>
<pre><code>[
  &quot;address&quot;,
  &quot;documentType&quot;,
  &quot;name&quot;,
  &quot;personalDetails&quot;
]
</code></pre>
<p>Which is missing the inner document keys. Any help here would be appreciated. This is part of a bigger problem that i solved using JS, however need to solve using MongoDB scripting. My JS solution is <a href="https://stackoverflow.com/a/69089199/3187750">here</a></p>
<p>FYI i am using free tier of Atlas, hence cannot use functions like map-reduce.</p>
<p>Thank you.</p>

