How can I provide default validation for all instances of a custom mongoose SchemaType?<p>I have followed the mongoose documentation for creating <a href="https://mongoosejs.com/docs/customschematypes.html" rel="nofollow noreferrer">Custom Schema Types</a>.  My implementation is functional, but does not yield the results I would like.</p>
<p>My goals is to have a custom schemaType that provides a custom error message when casting fails (or when casting succeeds but validation fails), without having to declare a validation method each time the data type is used in my api's schemas.</p>
<p>Here is an example (I will try to explain in the comments):</p>
<pre><code>const mongoose = require('mongoose')

// Create Custom Schema Type
class UUIDv4 extends mongoose.SchemaType {
    constructor(key, options) {
        super(key, options, 'UUIDv4');
    }

    cast(val) {
        if (/*Do UUIDv4 validation check here*/) {

            /* Because of the way mongoose works, this error message is difficult
               to present to a user because the built-in casting error message is 
               always used at the top level.
             */
            throw new Error(`${val} is not a valid version 4 UUID`);
        }
        return val;
    }
}

// Add `UUIDv4` to the type registry
mongoose.Schema.Types.UUIDv4 = UUIDv4;

const entitySchema = new mongoose.Schema({
    entityKey: {
        type: UUIDv4,
        required: true
    }
})

const Entity = mongoose.model('Entity', entitySchema)

const testEntity = new Entity({
    entityKey: &quot;123456789&quot;
})

testEntity.save().then(() =&gt; {
    console.log('done')
}).catch((e) =&gt; {
    console.log(e.errors.entityKey.reason.message) // This is where the custom message can be found
})
</code></pre>
<p>Obviously, I could skip creating the custom SchemaType, but I was hoping to avoid having to specify a custom validator each time an entityKey is used in my schemas (they are used a lot).</p>
<pre><code>const UUIDv4Validator = {
    validator: function(v) {
        // If is valid. . . return true
        // else return false
    },
    message: 'Invalid UUIDv4'
}

const entitySchema = new mongoose.Schema({
    entityKey: {
        type: String,
        required: true,
        validate: UUIDv4Validator // I don't want to have to do this every time
    }
})
</code></pre>
<p>I know that I could keep the custom Schema Type and check for the existence of this error in my try/catch statements using the optional chaining operator, but I would rather avoid the need, as it will be repetitive:</p>
<pre><code>try {
    // do stuff . . .
    await testEntity.save()
} catch (e) {
    const message = e?.errors?.entityKey?.reason?.message ?? e.message. // No thank you!
    // do stuff . . .
}
</code></pre>
<p>I tried reading the documentation to learn how to create a custom validation method for custom Schema Types, but I was unsuccessful at getting any attempts to work and so far I have found no examples online.</p>
<p><strong>How can I have a custom validator permanently linked to my UUIDv4 custom Schema Type that will evaluate the data that is attempting to be saved and, when appropriate, return my custom error message?</strong></p>

